import React from 'react';
import { Button } from 'react-bootstrap';

const HeaderNavigation = () => {
  const navItems = [
    { text: 'Как работи', weight: 800 },
    { text: 'услуги', weight: 900 },
    { text: 'За нас', weight: 700 },
    { text: 'Запиши се', weight: 700 }
  ];

  return (
    <div style={{
      width: '100%',
      maxWidth: '1120px',
      minHeight: '25px',
      display: 'flex',
      flexDirection: 'row',
      justifyContent: 'space-between',
      alignItems: 'center',
      gap: '110px',
      padding: '10px 20px',
      boxSizing: 'border-box'
    }}>
      {/* Logo Section */}
      <div style={{
        display: 'flex',
        flexDirection: 'row',
        alignItems: 'center',
        gap: '8px'
      }}>
        <img 
          src="https://dashboard.codeparrot.ai/api/image/Z7O5HTO_YEiK21yL/frame.png"
          alt="Checkers Logo"
          style={{
            width: '24px',
            height: '25.72px'
          }}
        />
        <span style={{
          fontFamily: 'Poppins',
          fontSize: '16px',
          fontWeight: 600,
          lineHeight: '150%',
          color: '#1572d3'
        }}>
          CHECKERS
        </span>
      </div>

      {/* Navigation Items */}
      <div style={{
        display: 'flex',
        flexDirection: 'row',
        alignItems: 'center',
        gap: '40px'
      }}>
        {navItems.map((item, index) => (
          <Button
            key={index}
            variant="link"
            style={{
              fontFamily: 'Poppins',
              fontSize: '16px',
              fontWeight: item.weight,
              lineHeight: '150%',
              color: '#484848',
              textTransform: 'capitalize',
              padding: '0',
              textDecoration: 'none',
              border: 'none'
            }}
            onMouseOver={(e) => e.target.style.color = '#1572d3'}
            onMouseOut={(e) => e.target.style.color = '#484848'}
          >
            {item.text}
          </Button>
        ))}
      </div>
    </div>
  );
};

HeaderNavigation.defaultProps = {
  navItems: [
    { text: 'Как работи', weight: 800 },
    { text: 'услуги', weight: 900 },
    { text: 'За нас', weight: 700 },
    { text: 'Запиши се', weight: 700 }
  ]
};

export default HeaderNavigation;
